CREATE TABLE `linkedDevices` (
  `id` int(11) NOT NULL,
  `name` varchar(256) NOT NULL,
  `bitsky_key` varchar(256) NOT NULL,
  `active` tinyint(1) NOT NULL DEFAULT '0'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `modules` (
  `id` int(11) NOT NULL,
  `name` varchar(255) NOT NULL,
  `state` tinyint(1) NOT NULL DEFAULT '1'
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

INSERT INTO `modules` (`id`, `name`, `state`) VALUES
(1, 'registration', 1);

CREATE TABLE `notifications` (
  `id` int(11) NOT NULL,
  `receiver_uniq_id` varchar(256) NOT NULL,
  `sender_uniq_id` varchar(256) NOT NULL,
  `element_id` int(11) NOT NULL,
  `element_type` varchar(50) NOT NULL,
  `action` varchar(50) NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `viewed` tinyint(1) NOT NULL DEFAULT '0',
  `link_id` int(11) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `postCommentFavorites` (
  `id` int(11) NOT NULL,
  `post_comment_id` int(11) NOT NULL,
  `user_uniq_id` varchar(256) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `postComments` (
  `id` int(11) NOT NULL,
  `owner_id` varchar(255) NOT NULL,
  `post_id` int(11) NOT NULL,
  `content` longtext NOT NULL,
  `favorites` int(11) NOT NULL DEFAULT '0',
  `link_id` int(11) DEFAULT NULL,
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4;

CREATE TABLE `postFavorites` (
  `id` int(11) NOT NULL,
  `post_id` int(11) NOT NULL,
  `user_uniq_id` varchar(256) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `posts` (
  `id` int(11) NOT NULL,
  `owner_uniq_id` varchar(256) NOT NULL,
  `content` varchar(1024) NOT NULL,
  `tag_id` int(11) NOT NULL,
  `favorites` int(11) NOT NULL DEFAULT '0',
  `comments` int(11) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `ranks` (
  `id` int(11) NOT NULL,
  `name` varchar(30) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `tags` (
  `id` int(11) NOT NULL,
  `name` varchar(50) NOT NULL,
  `uses` int(11) NOT NULL DEFAULT '0',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

CREATE TABLE `users` (
  `id` int(11) NOT NULL,
  `uniq_id` varchar(256) NOT NULL,
  `email` varchar(100) NOT NULL,
  `password` varchar(256) NOT NULL,
  `lastname` varchar(30) NOT NULL,
  `firstname` varchar(20) NOT NULL,
  `token` varchar(256) NOT NULL,
  `rank` tinyint(2) NOT NULL DEFAULT '1',
  `firsttime` tinyint(1) NOT NULL DEFAULT '1',
  `created_at` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  `updated_at` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `avatar` longtext NOT NULL,
  `biography` varchar(256) DEFAULT NULL,
  `sex` varchar(10) DEFAULT NULL,
  `birthdate` date DEFAULT NULL,
  `relationshipstatus` varchar(12) DEFAULT NULL,
  `job` varchar(50) DEFAULT NULL,
  `birthplace` varchar(50) DEFAULT NULL,
  `livingplace` varchar(50) DEFAULT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8;

